import React from 'react';
import GreetingsBlock from "./greetings";
import EducationParts from "./educationParts";

class FullLanding extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <React.Fragment>
                <GreetingsBlock/>
                <EducationParts/>
            </React.Fragment>
        );
    }
}

export default FullLanding;
